export const getInformes = () => {
	const url = 'https://demo3673607.mockable.io/informes';
	const body = {
		method: "GET",
	};

	return fetch(url, body)
	.then(res => {
		return res.json();
	})
	.catch(error => {
		console.log(error);
		return Promise.reject('Error in getInformes', error);
	});
}
